Actionscript.script:
function 刀剑攻击(子弹威力, Z轴攻击范围, 击倒率, 水平击退速度, 垂直击退速度)
{
	var 子弹参数 = new Object();
	子弹参数.子弹威力 = 子弹威力;
	if (_parent.被动技能.刀剑攻击 && _parent.被动技能.刀剑攻击.启用)
	{
		子弹参数.子弹威力 +=  _parent.刀属性.power * _parent.被动技能.刀剑攻击.等级 * 0.075;
	}
	if (_parent.mp攻击加成)
	{
		子弹参数.子弹威力 += _parent.mp攻击加成;
	}
	子弹参数.Z轴攻击范围 = Z轴攻击范围;
	子弹参数.击倒率 = 击倒率;
	子弹参数.水平击退速度 = 水平击退速度;
	if(垂直击退速度){
		子弹参数.垂直击退速度 = 垂直击退速度;
	}

	_parent.刀口位置生成子弹(_parent, 子弹参数);
}

子弹威力 = _parent.空手攻击力 / 5 + _parent.刀属性.power;
Z轴攻击范围 = 30;
击倒率 = 10;
水平击退速度 = 10;
刀剑攻击(子弹威力, Z轴攻击范围, 击倒率, 水平击退速度);

